const frogsData  = require('../data/frogsData.json');

function frogs(){
    let frogy = [];
    for(let f in frogsData){
        var img = frogsData[f]['image'];
        img = img ? require(img) : require('../assets/images/zdenek-machacek-WTr9TVVxZlQ-unsplash.jpg');
        let frogCleanse = {
            'id': frogsData[f]['id'],
            'name': frogsData[f]['name'],
            "image": img
        }
        frogy.push(frogCleanse);
    }
    
    return frogy;
}
export default frogs;
